var emojiList []rune

func RandEmoji(debug bool) rune {
    idx := rand.Int31n(int32(len(emojiList)))
    if debug {
        log.Println("emoji list:", len(emojiList), ", index:", idx)
    }
    return emojiList[idx]
}

func init() {
    for _, e := range EmojiListLit {
        if e == ' ' {
            continue
        }
        if e == '\n' {
            continue
        }
        if e == '\r' {
            continue
        }
        // zero width jointer
        if e == 8205 {
            continue
        }
        // variation selector
        if e == 65039 || e == 65038 {
            continue
        }
        emojiList = append(emojiList, e)
    }
    uniqMap := make(map[rune]bool)
    for _, e := range emojiList {
        uniqMap[e] = true
    }
    emojiList = nil
    for k, _ := range uniqMap {
        emojiList = append(emojiList, k)
    }
}
